// Write your code here

import {
  BarChart,
  Bar,
  XAxis,
  YAxis,
  Legend,
  ResponsiveContainer,
} from 'recharts'

const VaccinationByAge = props => {
  const {last7Days} = props
  console.log(last7Days)
  const DataFormatter = number => {
    if (number > 1000) {
      return `${(number / 1000).toString()}k`
    }
    return number.toString()
  }
  const data = [
    {
      group_name: 'Group A',
      boys: 200,
      girls: 400,
    },
    {
      group_name: 'Group B',
      boys: 3000,
      girls: 500,
    },
    {
      group_name: 'Group C',
      boys: 1000,
      girls: 1500,
    },
    {
      group_name: 'Group D',
      boys: 700,
      girls: 1200,
    },
  ]

  return (
    <ResponsiveContainer width="100%" height={500}>
      <BarChart
        data={data}
        margin={{
          top: 5,
        }}
      >
        <XAxis
          dataKey="group_name"
          tick={{
            stroke: 'gray',
            strokeWidth: 1,
          }}
        />
        <YAxis
          tickFormatter={DataFormatter}
          tick={{
            stroke: '',
            strokeWidth: 1,
          }}
        />
        <Legend
          wrapperStyle={{
            padding: 30,
          }}
        />
        <Bar dataKey="boys" name="Dose1" fill="#1f77b4" barSize="20%" />
        <Bar dataKey="girls" name="Dose2" fill="#fd7f0e" barSize="20%" />
      </BarChart>
    </ResponsiveContainer>
  )
}

export default VaccinationByAge
